for record in sdc.records:
  try:

    # Get the number of columns for each table
    num_columns = len(record.value['COLUMN_NAME'])

    # For each column...
    for i in range(0, num_columns):

      # Make sure we have a mapping for the SQLServer column type
      if record.value['DATA_TYPE'][i] in sdc.state['type_map'].keys():

        # Replace the SQLServer column data type with the Snowflake colunm data type
        record.value['DATA_TYPE'][i] = sdc.state['type_map'][record.value['DATA_TYPE'][i]]

      else:

        # Log a type mapping error stop processing this table
        record.value['TYPE_MAPPING_ERROR'] = 'No type mapping exists for SQLServer type: ' + record.value['DATA_TYPE'][i]
        break

    sdc.output.write(record)

  except Exception as e:
    sdc.error.write(record, str(e))

